import React from 'react';
import s from './Team.module.css';
import { NavLink } from 'react-router-dom';

let selectTeam = () => {
    //console.log("props.league_id="+props.league_id);
    props.selTeam(props.team_id);
    /*let action = setLeagueCreator(props.league_id);
    props.dispatch(action); */
  }

const Team = (props) => {
  return (<li key={props.team_key}>
                {props.team_name}
                <NavLink to={"/teamschedule/"+props.team_id} onClick={selectTeam}>   Расписание команды</NavLink>
               </li>      
  )  
}

export default Team;
